import{_ as s,o as a,c as n,O as l}from"./chunks/framework.4afe7240.js";const m=JSON.parse('{"title":"服务器的基础配置和项目部署","description":"","frontmatter":{},"headers":[],"relativePath":"服务器/服务器的基础配置和项目部署.md","filePath":"服务器/服务器的基础配置和项目部署.md","lastUpdated":null}'),p={name:"服务器/服务器的基础配置和项目部署.md"},e=l(`<h1 id="服务器的基础配置和项目部署" tabindex="-1">服务器的基础配置和项目部署 <a class="header-anchor" href="#服务器的基础配置和项目部署" aria-label="Permalink to &quot;服务器的基础配置和项目部署&quot;">​</a></h1><h2 id="一、拥有一台服务器" tabindex="-1">一、拥有一台服务器 <a class="header-anchor" href="#一、拥有一台服务器" aria-label="Permalink to &quot;一、拥有一台服务器&quot;">​</a></h2><h3 id="_1、腾讯云" tabindex="-1">1、腾讯云 <a class="header-anchor" href="#_1、腾讯云" aria-label="Permalink to &quot;1、腾讯云&quot;">​</a></h3><h3 id="_2、阿里云" tabindex="-1">2、阿里云 <a class="header-anchor" href="#_2、阿里云" aria-label="Permalink to &quot;2、阿里云&quot;">​</a></h3><h3 id="_3、华为云" tabindex="-1">3、华为云 <a class="header-anchor" href="#_3、华为云" aria-label="Permalink to &quot;3、华为云&quot;">​</a></h3><h3 id="_4、其他云服务器厂商" tabindex="-1">4、其他云服务器厂商 <a class="header-anchor" href="#_4、其他云服务器厂商" aria-label="Permalink to &quot;4、其他云服务器厂商&quot;">​</a></h3><p>本章以华为云为例</p><p>注：本文并未使用任何图形化工具，全程命令执行，请酌情观看</p><h2 id="二、登录服务器" tabindex="-1">二、登录服务器 <a class="header-anchor" href="#二、登录服务器" aria-label="Permalink to &quot;二、登录服务器&quot;">​</a></h2><h3 id="_1、华为云远程登录工具" tabindex="-1">1、华为云远程登录工具 <a class="header-anchor" href="#_1、华为云远程登录工具" aria-label="Permalink to &quot;1、华为云远程登录工具&quot;">​</a></h3><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242025607.png" alt="image-20230324202550435"></p><h3 id="_2、vscode使用remote-ssh远程登录" tabindex="-1">2、vscode使用Remote - SSH远程登录 <a class="header-anchor" href="#_2、vscode使用remote-ssh远程登录" aria-label="Permalink to &quot;2、vscode使用Remote - SSH远程登录&quot;">​</a></h3><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242032399.png" alt="image-20230324203221309"></p><p>华为云远程登录直接输入密码登录即可，vscode遇到连接错误也可百度解决，由于不是重点，不在此赘述，文使用华为云远程登录的方式配置</p><h2 id="三、安装nodejs" tabindex="-1">三、安装nodejs <a class="header-anchor" href="#三、安装nodejs" aria-label="Permalink to &quot;三、安装nodejs&quot;">​</a></h2><p>安装软件使用的工具：dnf</p><ul><li><strong>dnf</strong>全称dandified(时髦的、华丽的) <strong>Yum</strong></li><li>是<strong>yum</strong>的下一个版本，也被称之为<strong>yum</strong>的替代品</li><li>centos8自带<strong>dnf</strong></li></ul><p>检查<strong>dnf</strong>是否可用：</p><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">dnf </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">help</span></span></code></pre></div><p>如果我们希望安装一个软件包，可进行如下操作：</p><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 搜索软件名</span></span>
<span class="line"><span style="color:#A6ACCD;">dnf search nodejs</span></span>
<span class="line"></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 查看软件包信息</span></span>
<span class="line"><span style="color:#A6ACCD;">dnf info nodejs</span></span>
<span class="line"></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 安装nodejs</span></span>
<span class="line"><span style="color:#A6ACCD;">dnf install nodejs </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">y</span></span>
<span class="line"></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 查看node是否安装成功和安装的版本</span></span>
<span class="line"><span style="color:#A6ACCD;">node </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">v</span></span></code></pre></div><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242046199.png" alt="image-20230324204632142"></p><p>由于<strong>dnf</strong>能下载的版本较低，所以我们安装之后还需要进行版本升级</p><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 下载nodejs版本管理工具</span></span>
<span class="line"><span style="color:#A6ACCD;">npm install </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">g n </span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 安装最新的lts</span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">最新长期维护版</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;">版本</span></span>
<span class="line"><span style="color:#A6ACCD;">n install lts</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;">下载某一版本号node  n </span><span style="color:#F78C6C;">10.16.0</span></span>
<span class="line"><span style="color:#A6ACCD;">n </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">version</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;"> </span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;">删除某个版本   n  rm </span><span style="color:#F78C6C;">10.16.0</span></span>
<span class="line"><span style="color:#A6ACCD;">n rm </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">version</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;">  </span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;">输入命令后直接使用上下箭头选择版本</span></span>
<span class="line"><span style="color:#A6ACCD;">n</span></span></code></pre></div><p>如果版本切换不生效，退出重新登录即可</p><h2 id="四、安装mysql" tabindex="-1">四、安装mysql <a class="header-anchor" href="#四、安装mysql" aria-label="Permalink to &quot;四、安装mysql&quot;">​</a></h2><h3 id="_1、查看是否有mysql-server-centeos7是没有的" tabindex="-1">1、查看是否有<strong>mysql-server</strong>，<strong>centeos7</strong>是没有的 <a class="header-anchor" href="#_1、查看是否有mysql-server-centeos7是没有的" aria-label="Permalink to &quot;1、查看是否有**mysql-server**，**centeos7**是没有的&quot;">​</a></h3><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 搜索软件名</span></span>
<span class="line"><span style="color:#A6ACCD;">dnf search mysql</span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">server</span></span>
<span class="line"></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 查看软件包信息</span></span>
<span class="line"><span style="color:#A6ACCD;">dnf info mysql</span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">server</span></span>
<span class="line"></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 安装nodejs</span></span>
<span class="line"><span style="color:#A6ACCD;">dnf install mysql</span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">server </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">y</span></span></code></pre></div><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242106540.png" alt="image-20230324210653487"></p><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242109782.png" alt="安装成功"></p><h3 id="_2、启动mysql-server" tabindex="-1">2、启动mysql-server <a class="header-anchor" href="#_2、启动mysql-server" aria-label="Permalink to &quot;2、启动mysql-server&quot;">​</a></h3><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 开启MySQL后台服务</span></span>
<span class="line"><span style="color:#A6ACCD;">systemctl start mysqld</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 查看MySQL服务 active</span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">running</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;">表示启动成功</span></span>
<span class="line"><span style="color:#A6ACCD;">systemctl status mysql</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 随着系统一起启动</span></span>
<span class="line"><span style="color:#A6ACCD;">systemctl enable mysqld</span></span></code></pre></div><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242116560.png" alt="数据库服务启动成功"></p><h3 id="_3、配置mysql-server" tabindex="-1">3、配置mysql-server <a class="header-anchor" href="#_3、配置mysql-server" aria-label="Permalink to &quot;3、配置mysql-server&quot;">​</a></h3><p>由于<strong>dnf</strong>安装<strong>mysql-server</strong>时并未设置密码，所以我们需要做些配置，方便后面远程连接</p><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">mysql_secure_installation</span></span>
<span class="line"></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 接下来会出现一些选项，重点在于选择密码强度，mysql8</span><span style="color:#F78C6C;">.0</span><span style="color:#A6ACCD;">对密码强度要求较高，大概需要特殊字符和数字和大小写字母分别都有</span></span></code></pre></div><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242122826.png" alt="image-20230324212218745"></p><p>我在<strong>Disallow root login remotely</strong>选择时填了<strong>n</strong>,允许远程访问</p><h3 id="_4、使用navicat远程连接mysql" tabindex="-1">4、使用Navicat远程连接MySQL <a class="header-anchor" href="#_4、使用navicat远程连接mysql" aria-label="Permalink to &quot;4、使用Navicat远程连接MySQL&quot;">​</a></h3><p>有几个重点：</p><ul><li>服务器的安全组需要加入3306的端口</li><li>主机需要填服务器的公网ip</li><li>设置MySQL的root用户接受远程连接</li></ul><p>进入mysql服务，并切换到mysql数据库，查看uesr表</p><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">mysql </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">u root </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">p</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 进入mysql数据库</span></span>
<span class="line"><span style="color:#A6ACCD;">use mysql</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 查看user表的host、user字段</span></span>
<span class="line"><span style="color:#A6ACCD;">select host</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> user from user</span><span style="color:#89DDFF;">;</span></span></code></pre></div><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242148184.png" alt="image-20230324214831135"></p><p>默认只能lcoalhost本机连接，我们要更改为所有都能连接(酌情配置，此操作有被攻击的风险)</p><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">update user set host </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">%</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;"> where user </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">root</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 配置后保险起见，刷新一下</span></span>
<span class="line"><span style="color:#A6ACCD;">flush privileges</span><span style="color:#89DDFF;">;</span></span></code></pre></div><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242150953.png" alt="image-20230324215032915"></p><p>然后就能进行远程连接了，连接名随意</p><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242152094.png" alt="image-20230324215210993"></p><h3 id="_5、利用navicat进行数据库数据的拷贝" tabindex="-1">5、利用Navicat进行数据库数据的拷贝 <a class="header-anchor" href="#_5、利用navicat进行数据库数据的拷贝" aria-label="Permalink to &quot;5、利用Navicat进行数据库数据的拷贝&quot;">​</a></h3><h4 id="_5-1、转存sql文件" tabindex="-1">5.1、转存<strong>sql</strong>文件 <a class="header-anchor" href="#_5-1、转存sql文件" aria-label="Permalink to &quot;5.1、转存**sql**文件&quot;">​</a></h4><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242156366.png" alt="image-20230324215614280"></p><h4 id="_5-2、执行sql文件" tabindex="-1">5.2、执行<strong>sql</strong>文件 <a class="header-anchor" href="#_5-2、执行sql文件" aria-label="Permalink to &quot;5.2、执行**sql**文件&quot;">​</a></h4><p><img src="https://gitee.com/jiumuri/images/raw/master/PicGo-updata-img/202303242157793.png" alt="image-20230324215740671"></p><h2 id="五、上传文件到服务器" tabindex="-1">五、上传文件到服务器 <a class="header-anchor" href="#五、上传文件到服务器" aria-label="Permalink to &quot;五、上传文件到服务器&quot;">​</a></h2><h3 id="_1、上传文件" tabindex="-1">1、上传文件 <a class="header-anchor" href="#_1、上传文件" aria-label="Permalink to &quot;1、上传文件&quot;">​</a></h3><p>至此基础环境已经具备了，接下来就可以上传文件让服务器运行</p><p>上传文件主要有三种方式</p><ul><li>使用工具直接拷贝到服务器</li><li>将文件上传到<strong>git</strong>仓库，远程服务器再<strong>git clone</strong></li><li>使用自动化部署，例如<strong>jenkins</strong></li></ul><p>本文主要使用上传到git仓库的方式</p><h3 id="_2、将代码上传到自己git仓库-这里以github为例" tabindex="-1">2、将代码上传到自己Git仓库，这里以github为例 <a class="header-anchor" href="#_2、将代码上传到自己git仓库-这里以github为例" aria-label="Permalink to &quot;2、将代码上传到自己Git仓库，这里以github为例&quot;">​</a></h3><ul><li>通过填写**.gitignore文件**忽略一些私人配置文件和node_moduls</li></ul><h3 id="_3、将代码clone到服务器" tabindex="-1">3、将代码clone到服务器 <a class="header-anchor" href="#_3、将代码clone到服务器" aria-label="Permalink to &quot;3、将代码clone到服务器&quot;">​</a></h3><ul><li>创建存放代码的文件夹</li></ul><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 进入根目录</span></span>
<span class="line"><span style="color:#A6ACCD;">cd </span><span style="color:#89DDFF;">..</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 安装git工具</span></span>
<span class="line"><span style="color:#A6ACCD;">dnf install git </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">y</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 执行clone命令</span></span>
<span class="line"><span style="color:#A6ACCD;">git clone 仓库地址</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 可能会报错，执行以下命令即可</span></span>
<span class="line"><span style="color:#A6ACCD;">git config </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">global http</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">sslVerify </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">false</span><span style="color:#89DDFF;">&quot;</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 产生原因：一般是这是因为服务器的SSL证书没有经过第三方机构的签署，所以才报错</span></span></code></pre></div><h3 id="_4、运行代码" tabindex="-1">4、运行代码 <a class="header-anchor" href="#_4、运行代码" aria-label="Permalink to &quot;4、运行代码&quot;">​</a></h3><p>pm2介绍：</p><blockquote><p>PM2是一个用于Node.js应用程序的生产过程管理器，具有内置的负载均衡器。它允许您让应用程序永远处于活动状态，在没有停机时间的情况下重新加载它们，并方便执行常见的系统管理任务。</p></blockquote><p>本文用到的是<strong>pm2</strong> 进程管理，nodejs项目一直运行，<a href="https://gitee.com/mirrors/pm2" target="_blank" rel="noreferrer">仓库看看</a></p><p>介绍完工具后，我们开始在服务器上运行代码</p><div class="language-apl"><button title="Copy Code" class="copy"></button><span class="lang">apl</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 安装依赖</span></span>
<span class="line"><span style="color:#A6ACCD;">npm install </span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 启动应用</span></span>
<span class="line"><span style="color:#A6ACCD;">pm2 start main</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">js </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">name 应用名称</span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">自定义</span><span style="color:#89DDFF;">)</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 监控应用目录，一旦有文件发生更改就立刻重启应用</span></span>
<span class="line"><span style="color:#A6ACCD;">pm2 start app</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">js </span><span style="color:#89DDFF;">--</span><span style="color:#A6ACCD;">watch</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 重启</span></span>
<span class="line"><span style="color:#A6ACCD;">pm2 restart app_name</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">app_id</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">all</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 重载</span></span>
<span class="line"><span style="color:#A6ACCD;">pm2 reload app_name</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">app_id</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">all</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 停止</span></span>
<span class="line"><span style="color:#A6ACCD;">pm2 stop app_name</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">app_id</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">all</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 删除</span></span>
<span class="line"><span style="color:#A6ACCD;">pm2 delete app_name</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">app_id</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">all</span></span>
<span class="line"><span style="color:#89DDFF;">#</span><span style="color:#A6ACCD;"> 查看运行状态</span></span>
<span class="line"><span style="color:#A6ACCD;">pm2 </span><span style="color:#89DDFF;">[</span><span style="color:#A6ACCD;">list</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">ls</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">status</span><span style="color:#89DDFF;">]</span></span></code></pre></div><h2 id="六、结尾" tabindex="-1">六、结尾 <a class="header-anchor" href="#六、结尾" aria-label="Permalink to &quot;六、结尾&quot;">​</a></h2><h4 id="_6-1、vue-react项目在服务器运行" tabindex="-1">6.1、vue/react项目在服务器运行 <a class="header-anchor" href="#_6-1、vue-react项目在服务器运行" aria-label="Permalink to &quot;6.1、vue/react项目在服务器运行&quot;">​</a></h4><p>至此便可以将自己的项目部署到服务器，纯前端项目部署时的几种方式</p><ul><li>使用node+express编写一个静态资源服务器，当然其他语言也是可以</li><li>部署到nginx服务器上，通过设置conf配置文件来进行外网访问</li><li>部署到tomcat服务器上</li></ul><p>这几种方式都需要一些别的前置知识，要自行补充学习</p><h4 id="_6-2、别的补充" tabindex="-1">6.2、别的补充 <a class="header-anchor" href="#_6-2、别的补充" aria-label="Permalink to &quot;6.2、别的补充&quot;">​</a></h4><p>使用全命令行的方式进行部署的话，需要对<strong>linux</strong>命令有一些基本的了解，在此贴一篇<strong>linux</strong>常用命令的文章，便于查询和学习，<a href="https://mp.weixin.qq.com/s?__biz=MzI3MjY1ODI2Ng==&amp;mid=2247485996&amp;idx=1&amp;sn=0a08bf2f04eed49542a96cee6928a561&amp;chksm=eb2e7019dc59f90f55b0aaabf7a59a16a4e06bf941beda82e2e61e807da3ca8d4c2e247173ad&amp;scene=27" target="_blank" rel="noreferrer">文章地址</a></p>`,78),o=[e];function t(r,c,i,D,y,C){return a(),n("div",null,o)}const d=s(p,[["render",t]]);export{m as __pageData,d as default};
